DROP TABLE IF EXISTS `planlama`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `planlama` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `firma_id` int(11) NOT NULL,
  `siparis_id` int(11) NOT NULL,
  `alt_urun_id` tinyint(3) unsigned NOT NULL,
  `grup_kodu` char(13) NOT NULL COMMENT 'Alt ürünlerin her biri için aktar olayında aynı değere sahip olmalı ki aynı alt ürüne ait olduğunu bilmek için',
  `sira` int(11) DEFAULT '99',
  `isim` varchar(255) NOT NULL,
  `asama_sayisi` tinyint(3) unsigned NOT NULL,
  `mevcut_asama` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `uretilecek_adet` int(10) unsigned NOT NULL,
  `biten_urun_adedi` int(10) unsigned DEFAULT '0',
  `teslim_edilen_urun_adedi` int(10) unsigned DEFAULT '0',
  `departmanlar` json NOT NULL,
  `orijinal_adetler` json NOT NULL,
  `adetler` json NOT NULL,
  `sureler` json NOT NULL,
  `detaylar` json NOT NULL,
  `makinalar` json NOT NULL,
  `arsiv_altlar` json NOT NULL,
  `stok_kalemler` json NOT NULL,
  `stok_alt_kalemler` json NOT NULL,
  `stok_alt_depo_adetler` json NOT NULL,
  `stok_alt_depolar` json NOT NULL,
  `fason_durumlar` json NOT NULL,
  `fason_tedarikciler` json NOT NULL,
  `notlar` json DEFAULT NULL,
  `tarih` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `durum` enum('baslamadi','basladi','beklemede','bitti','fasonda') NOT NULL DEFAULT 'baslamadi',
  `onay_durum` enum('evet','hayır') NOT NULL DEFAULT 'hayır',
  `planlama_durum` enum('evet','hayır','yarım_kalmıs') NOT NULL DEFAULT 'hayır',
  `durum_not` mediumtext,
  `teslim_durumu` enum('bitti','bitmedi') NOT NULL DEFAULT 'bitmedi',
  `tekil_kod` char(13) NOT NULL COMMENT 'her beklemeye aldığında değişecek loglar için kullanılıyor',
  `asamada_eksik_adet_varmi` enum('var','yok','uret') NOT NULL DEFAULT 'yok',
  `eksik_adet` int(11) NOT NULL DEFAULT '0',
  `aktar_durum` enum('orijinal','eklendi') NOT NULL DEFAULT 'orijinal' COMMENT 'Aktar durumda aşamada daha önceden varsa üzerine eklenir',
  `eksik_stok_varmi` enum('var','yok') NOT NULL DEFAULT 'yok',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2804 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

